DROP TABLE IF EXISTS `clients`;
CREATE TABLE "clients" ("id" INT primary key autoincrement not null, "name" varchar not null, "phone" varchar, "email" varchar, "address" text, "created_at" DATETIME, "updated_at" DATETIME);


DROP TABLE IF EXISTS `vehicles`;
CREATE TABLE "vehicles" ("id" INT primary key autoincrement not null, "vin" varchar not null, "manufacturer" varchar not null, "model" varchar not null, "vehicle_type" varchar not null, "transmission" varchar, "engine_number" varchar, "registration_number" varchar, "year" INT, "mileage" INT, "created_at" DATETIME, "updated_at" DATETIME);


DROP TABLE IF EXISTS `inspections`;
CREATE TABLE "inspections" ("id" INT primary key autoincrement not null, "client_id" INT not null, "vehicle_id" INT not null, "inspector_name" varchar not null, "inspector_phone" varchar, "inspector_email" varchar, "inspection_date" date not null, "diagnostic_report" text, "status" varchar check ("status" in ('draft', 'completed', 'sent')) not null default 'draft', "created_at" DATETIME, "updated_at" DATETIME, foreign key("client_id") references "clients"("id"), foreign key("vehicle_id") references "vehicles"("id"));


DROP TABLE IF EXISTS `body_panel_assessments`;
CREATE TABLE "body_panel_assessments" ("id" INT primary key autoincrement not null, "inspection_id" INT not null, "panel_name" varchar not null, "condition" varchar check ("condition" in ('good', 'average', 'bad')), "comment_type" varchar, "additional_comment" text, "other_notes" text, "created_at" DATETIME, "updated_at" DATETIME, foreign key("inspection_id") references "inspections"("id") on delete cascade);


DROP TABLE IF EXISTS `inspection_images`;
CREATE TABLE "inspection_images" ("id" INT primary key autoincrement not null, "inspection_id" INT not null, "image_type" varchar check ("image_type" in ('general', 'specific_area')) not null, "area_name" varchar, "file_path" varchar not null, "original_name" varchar, "latitude" numeric, "longitude" numeric, "created_at" DATETIME, "updated_at" DATETIME, foreign key("inspection_id") references "inspections"("id") on delete cascade);


